import React, { useState } from 'react';
import api from '../api';

const CadastroFan = () => {
  const [fan, setFan] = useState({
    nome: '',
    email: '',
    cpf: '',
    interesses: '',
    endereco: ''
  });

  const handleChange = (e) => {
    setFan({ ...fan, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await api.post('/', fan); // Certifique-se de que baseURL é /api/fans
      alert("Fã cadastrado com sucesso! ID: " + response.data.id);
    } catch (error) {
      console.error("Erro ao cadastrar fã:", error);
      alert("Erro ao cadastrar fã. Verifique o console para mais detalhes.");
    }
  };

  return (
    <div>
      <h2>Cadastro de Fã</h2>
      <form onSubmit={handleSubmit}>
        <input name="nome" placeholder="Nome" onChange={handleChange} value={fan.nome} required />
        <input name="email" placeholder="Email" onChange={handleChange} value={fan.email} required />
        <input name="cpf" placeholder="CPF" onChange={handleChange} value={fan.cpf} required />
        <input name="interesses" placeholder="Interesses" onChange={handleChange} value={fan.interesses} required />
        <input name="endereco" placeholder="Endereço" onChange={handleChange} value={fan.endereco} required />
        <button type="submit">Cadastrar</button>
      </form>
    </div>
  );
};

export default CadastroFan;
